package com.baizhi.entity;/** * Created by dell on 2018/6/4. */public class UserPro {    private String id;    private String text;    @Override    public String toString() {        return "UserPro{" +                "id='" + id + '\'' +                ", text='" + text + '\'' +                '}';    }    public String getText() {        return text;    }    public void setText(String text) {        this.text = text;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public UserPro() {    }    public UserPro(String id, String text) {        this.id = id;        this.text = text;    }}